description:
The set consists of 10 pieces. 8 pieces with clips and two test wefts without clips:
one 8'' weft, 3 clips;
one 7'' weft, 3 clips;
one 6'' weft, 3 clips; 
one 5-3/4'' weft, 3 lips;
four 1-1/2'' wefts, 1 clip each;
and two 1'' wefts without clips to test for color. The texture is silky straight. The hair can be dyed, and can be curled with a hot iron. By Alexxis.
